import React from 'react';
import { Col, Row } from 'reactstrap';
import './Footer.scss';

const Footer = () => {
    const footerDetails = [{
        link: 'Tell us your plan',
        title: 'Give us details like the group size, Safari duration, parks and reserves you wish to visit.'
    },{
        link: 'Get a customized package',
        title: 'Talk to our Safari experts and get the customized package within 1 business day.'
    },{
        link: 'Book your Safari',
        title: 'Book your Safari with our easy and secure booking process. Experience wilderness!'
    }];

    const renderInfoCard = () => {
        return footerDetails.map((data, i) => {
            return (
                <Col sm="4" key={i}>
                    <div>
                        {data.title}
                    </div>
                </Col>
            )
        });
    }

    const date = new Date();
    return(
        <footer>
            <div className="wrapper">
                <Row>
                    {
                        renderInfoCard()
                    }
                </Row>
                <div className="copyright">
                    &copy; Copyright {date.getFullYear()}  Full of Africa. All Rights Reserved.
                </div>
            </div>
        </footer>
    );
}

export default Footer;
